import Chart from "../chart/Chart";
import "./widgetLg.css";

export default function WidgetLg() {
  const Button = ({ type }) => {
    return <button className={"widgetLgButton " + type}>{type}</button>;
  };
  return (
    <div className="widgetLg">
      <h3 className="widgetLgTitle">Time Sheet Entry </h3>
      <Chart/>
    </div>
  );
}
